import React from "react"
import boxes from "./boxes"
import './App.css';

function App() {
  const [box, setBox] = React.useState(boxes)
  const styles ={
    backgroundColor: "black"
  }
  const boxesMap = box.map(()=>(<Box style={styles} className="box" key={box.id} on={box.on}/>))
  return (
    <div className="boxes">
      {boxesMap}
    </div>
  )
}

export default App;
